describe("scaleY (method)",()=>{it("should be scaled in the y-axis",e=>{const a=window.createImage(),t=new Cropper(a,{ready(){const a=t.scaleY(-1).getImageData();expect(a.scaleY).to.equal(-1),e()}})}),it("should not work when it is not scalable",e=>{const a=window.createImage(),t=new Cropper(a,{scalable:!1,ready(){const a=t.scaleY(-1).getImageData();expect(a.scaleY).to.be.undefined,e()}})})});